import styel from './Products.module.css'

const Products = () => {

  const data = []
  const map = data.map((ev, i) => (
    <div key={i}>
    </div>
  ))

  return (
    <div className={styel.body}>
      {data.length > 0 ?
        { map }
        :
        <p>There is no book here.</p>

      }
    </div>
  )
}
export default Products
